      SELECT col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( ( - 6 ) + - - col2 ) IN ( - col2 * - 2, ( - - col0 ), + ( col1 ) );
  - name: tab1

outputs:
